import React from 'react';

import './Explorar.css';

import Header from '../components/Header';
import Footer from '../components/Footer';

const Explorar = () => (
  <div>
    <Header />
    <div className="main-explore">
      <button
        type="button"
        data-testid="explore-food"
      >
        Explorar Comidas
      </button>
      <button
        type="button"
        data-testid="explore-drinks"
      >
        Explorar Bebidas
      </button>
    </div>
    <Footer />
  </div>
);

export default Explorar;
